        <div className="card-image-container">
          {/* <img src="images/card.svg" alt="na" /> */}
          <ImCreditCard style={{ fontSize: "130px" }} />
        </div>
        <div className="card-text-container">
          <h1>Credit Card</h1>
          <p>
            Lorem ipsum, dolor sit amet consectetur adipisicing elit. Id iste
